import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import NavigationBar from "./SimpleComponents/NavBar";
import NameList from "./NameList";
import Home from "./Home";
import AboutUs from "./AboutUs";

function App() {
  return (
    <React.Fragment>
      <BrowserRouter>
        <NavigationBar />

        <Route path="/aboutus">
          <AboutUs />
        </Route>
        <Route path="/nameList">
          <NameList />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </BrowserRouter>
    </React.Fragment>
  );
}
export default App;
